import React from "react";

import Course from '../../image/CourseDataset.png';
import Room from '../../image/RoomDataset.png';
import GenerateButton from "./GenerateBtn";
import UploadFile from "./UploadFile";
import './UploadPage.css'

const UploadPage = () => {
    return (
        <React.Fragment>
            <div className="upload-page">
                <div className="upload-page__content">
                    <img src={Course} alt="CourseDataset"></img>
                    <img src={Room} alt="RoomDataset"></img>
                </div>
                <div className="upload-page__textbox"></div>
                <div className="upload-page__button">
            <div
            className="upload-file"
            onDragEnter={()=>{setHighlighted(true);}}
            onDragLeave={()=>{setHighlighted(false);}}
             onDragOver={e =>{
                e.preventDefault();
            }} onDrop={(e) => {
                e.preventDefault();
                setHighlighted(false);
                Array.from(e.dataTransfer.files).filter(file => file.type === "text/csv").forEach(file =>{
                    console.log(file);
                });
            }} >
                Drag File Here
            </div>
                    <GenerateButton></GenerateButton>  
                </div>
            </div>
        </React.Fragment>
        
    );
};

export default UploadPage;
